#include "get_products.h"

inline
void	delete_product_list(product_list_t *products) {
	product_list_t *product;
	product_list_t *tempProduct;

	product = products;

	if(product) {
		tempProduct = product;
		while(tempProduct != NULL) {
			tempProduct = product->nextProduct;

			vPortFree(product->productName);
			vPortFree(product);
			product = tempProduct;
		}
	}
}

inline
json_t *getProductPrice(product_list_t *product) {
	json_t *priceJson = NULL;

	priceJson = json_object();
	json_object_set_new(priceJson, "amount", json_real(product->productPrice));

	switch(product->currency) {
	case 	EUR:
		json_object_set_new(priceJson, "currency", json_string("EUR"));
		break;
	case 	USD:
		json_object_set_new(priceJson, "currency", json_string("USD"));
		break;
	case 	LTL:
		json_object_set_new(priceJson, "currency", json_string("LTL"));
		break;
	case 	LVL:
		json_object_set_new(priceJson, "currency", json_string("LVL"));
		break;
	case	RUB:
		json_object_set_new(priceJson, "currency", json_string("RUB"));
		break;
	case	SEK:
		json_object_set_new(priceJson, "currency", json_string("SEK"));
		break;

	default:
		break;
	}

	return priceJson;
}


